        GH3X_ALGO_LOG_PARAM("in.acc %f,%f,%f, in.gsr %f \n", in.accX[0],in.accY[0],in.accZ[0], in.gsr[0]);
//        GH3X_ALGO_LOG_PARAM("in.acc %f,%f,%f, in.gsr %f \n", in.accX[1],in.accY[1],in.accZ[1], in.gsr[1]);
